import * as React from "react";
import { useState } from "react";
import TextField from "@mui/material/TextField";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import PropTypes from "prop-types";
//import InfoRounded from "@bit/mui-org.material-ui-icons.info-rounded";
import { Button } from "@mui/material";

const AddSiteForm = React.forwardRef((props, ref) => {
  const { text, matomoId: savedMatomoId, onClose, action, onSaveData } = props;

  const [value, setValue] = useState(text);
  const [matomoId, setMatomoId] = useState(savedMatomoId);
  const [open, setOpen] = React.useState(true);

  const handleClose = () => {
    onClose();
  };

  const handleSave = () => {
    onSaveData({ matomoId, name: value }, action);
    setOpen(false);
  };

  const handleValueChange = (event) => {
    setValue(event.target.value);
  };

  const handleIdChange = (event) => {
    setMatomoId(event.target.value);
  };

  return (
    <div>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Ajouter un Site</DialogTitle>
        <DialogContent>
          <DialogContentText>Veuillez saisir le nom du site et l&apos;Id Matomo</DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="site"
            label="Site"
            type="text"
            fullWidth
            variant="standard"
            defaultValue={text}
            onChange={handleValueChange}
          />
          <TextField
            autoFocus
            margin="dense"
            id="matomoId"
            label="matomoId"
            type="text"
            fullWidth
            variant="standard"
            defaultValue={matomoId}
            onChange={handleIdChange}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSave}>Save</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
});

AddSiteForm.propTypes = {
  border: PropTypes.bool,
  boxShadow: PropTypes.bool,
  children: PropTypes.node,
  content: PropTypes.bool,
  contentClass: PropTypes.string,
  contentSX: PropTypes.object,
  darkTitle: PropTypes.bool,
  secondary: PropTypes.oneOfType([PropTypes.node, PropTypes.string, PropTypes.object]),
  shadow: PropTypes.string,
  sx: PropTypes.object,
  title: PropTypes.oneOfType([PropTypes.node, PropTypes.string, PropTypes.object]),
};
export default AddSiteForm;
